let page, idPage;
page = document.location.href;
idPage = page.substring(page.lastIndexOf("?") + 1);
const HiraganaGame = () => {
    return (

        <div id="left">
            <h3 id="textRight">Syllabes simples</h3>
            <div class="lecon" onclick="">
                <div class="button">
                    <h3>Leçon 1</h3>
                    <a href="#">Jouer</a>
                </div>
                <table>
                    <tr>
                        <td>{idPage}</td>
                        <td class="voc" onclick="">あ<br />a</td>
                        <td class="voc">い<br />i</td>
                        <td class="voc">う<br />u</td>
                        <td class="voc">え<br />e</td>
                        <td class="voc">お<br />o</td>
                    </tr>
                </table>
            </div>
        </div>

    );
};
export default HiraganaGame;
